import React from "react";
import { Link } from "react-router-dom";
import "./header.scss";

/**
 * Component to render header
 * @param {*} props 
 */
const Header = props => {
  return (
    <header>
      <h1>CanU</h1>
    </header>
  );
};

export default Header;
